#include <stdio.h>
#include <stdlib.h>

int main()
{
    int n;
    int i;
    scanf("%d",&n);
    int temp = n;
    if(n==1)
        printf("%d = 1",n);
    else
    {
        printf("%d = ",n);
        for(i=2;i<temp;i++)
        {
            if(n%i==0)
            {
                n=n/i;
                if (n!=1)
                    printf("%d x ",i);
                else
                    printf("%d",i);
                i--;
            }
        }
    }
    return 0;
}
